import React from 'react';
import img from '../../images/p-1.png';
export default function Card(){
    return(
        <>
          <div className="p-c">
              <div className="p-c-img">
                 <img src={img} alt="" />
              </div>
              <div className="p-c-title">
                  Typing.. Test
              </div>
              <div className="p-c-des">
                This is a Typing Test game where you can get
                your typing speed and accuracy .
              </div>
          </div>
        </>
    )
}
